import React from 'react';
import { Container, Typography } from '@mui/material';

const Dashboard = () => {
  return (
    <Container>
      <Typography variant="h4" gutterBottom>
        Dashboard
      </Typography>
      <Typography>
        User dashboard - Coming soon in next task
      </Typography>
    </Container>
  );
};

export default Dashboard;
